import * as d3 from 'd3'
import { useState, useEffect } from 'react'

function Weight({ activitiesData }) {
    const [SvgWeight, setSvgWeight] = useState()

    useEffect(() => {
        const SvgWeightCreation = d3
            .select('.weight-box')
            .append('svg')
            .attr('width', 825)
            .attr('height', 320)
            .style('background', '#FBFBFB')
            .style('border-radius', '5px')
            .append('g')
            .attr('width', 685)
            .attr('height', 140)
        setSvgWeight(SvgWeightCreation)
    }, [])

    return (
        <div className="rounded-md col-span-3 weight-box">
            {console.log(activitiesData[1].calories + ' bananas')}
        </div>
    )
}

export default Weight
